import React from 'react'
import { useDispatch } from 'react-redux'
import { Link, useNavigate } from "react-router-dom";

const NavbarUser = () => {
  const navigate = useNavigate()
  const dispatch = useDispatch()
  const logout = () => {
    dispatch({
      type:'LOGOUT',
      payload: null,
    })
    alert('ออกจากระบบ')
    navigate('/')
  }
  return (
    <div>
      <nav class="navbar col-md-12 navbar-expand-sm navbar-dark bg-success sticky-top">
        <div class="col-md-1"></div>
        <div class="container-fluid">
          <Link to="/admin/index" class="navbar-brand">ระบบจองหอพัก</Link>
          <div class="collapse navbar-collapse" id="navbarToggle">
            <ul class="navbar-nav">
          
            </ul>
          </div>
          <ul class="navbar-nav">
            <li class="nav-item">
              <a class="nav-link me-3" onClick={logout}><i class="fa-solid fa-right-from-bracket"></i></a>
            </li>
          </ul>
        </div>
        <div class="col-md-1"></div>
      </nav>
    </div>
  )
}

export default NavbarUser
